import React, { Component } from 'react';


class Form extends Component {
  
  render() { 
    return (
      <form>
      <label>First Name:</label>
      <input type='text'/><br />
      <label>Surname:</label>
      <input type='text'/><br />
      <label>Email:</label>
      <input type='email'/><br />
      <label>Phone Number:</label>
      <input type='number'/><br />
      <input type="Submit" />
      </form>
      
    );
  }
}
 
export default Form;
